import React from 'react';
//import logo from './logo.svg';
import './App.css';
import Header from "./Header"
import Navbar from "./Navbar"
import Socials from "./Socials"
import Footer from "./Footer"

function App() {
  return (
    <div>
        <Header />
        <Navbar />
        <Socials />
        <Footer />
    </div>
  );
}

export default App;
